{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/judechimezuruonyenwe/cyclistic-bike-share-capstone-project?scriptVersionId=193368923\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"15b17801","metadata":{"papermill":{"duration":0.012957,"end_time":"2024-08-20T23:19:13.07216","exception":false,"start_time":"2024-08-20T23:19:13.059203","status":"completed"},"tags":[]},"source":["# **Introduction**\n","\n","This is the first case study for the Google Data Analytics Professional Capstone Project on Coursera. In order to complete this case study, I will be using my understanding of the Data Analysis processes which according to the Google Data Analytics Professional Course are; ***Ask***, ***Prepare***, ***Process***, ***Analyze***, ***Share*** and ***Act***. \n","\n","## **Scenario**\n","\n","I am a junior data analyst working in the marketing analyst team at Cyclistic, a bike-share company in Chicago. The director of marketing believes that the company’s future success depends on maximizing the number of annual memberships. Therefore, my team wants to understand how casual riders and annual members use Cyclistic bikes differently. From these insights, my team will design a new marketing strategy to convert casual riders into annual members.\n","\n","## **Characters and teams**\n","\n","● **Cyclistic**: A bike-share program that features more than 5,800 bicycles and 600 docking stations. Cyclistic sets itself apart by also offering reclining bikes, hand tricycles, and cargo bikes, making bike-share more inclusive to people with disabilities and riders who can’t use a standard two-wheeled bike. \n"," \n","● **Lily Moreno**: The director of marketing and my manager.\n","\n","● **Cyclistic marketing analytics team**: A team of data analysts who are responsible for collecting, analyzing, and reporting data that helps guide Cyclistic marketing strategy.\n","\n","● **Cyclistic executive team**: The notoriously detail-oriented executive team will decide whether to approve the recommended marketing program.\n","\n","## **About the company**\n","\n","Until now, Cyclistic’s marketing strategy relied on building general awareness and appealing to broad consumer segments. One approach that helped make these things possible was the flexibility of its pricing plans: single-ride passes, full-day passes, and annual memberships. Customers who purchase single-ride or full-day passes are referred to as casual riders. Customers who purchase annual memberships are Cyclistic members.\n","\n","Cyclistic’s finance analysts have concluded that annual members are much more profitable than casual riders. Although the pricing flexibility helps Cyclistic attract more customers, Moreno believes that maximizing the number of annual members will be key to future growth. Rather than creating a marketing campaign that targets all-new customers, Moreno believes there is a very good chance to convert casual riders into members. She notes that casual riders are already aware of the Cyclistic program and have chosen Cyclistic for their mobility needs.\n","\n","Moreno has set a clear goal: Design marketing strategies aimed at converting casual riders into annual members. In order to do that, however, the marketing analyst team needs to better understand how annual members and casual riders differ, why casual riders would buy a membership, and how digital media could affect their marketing tactics. Moreno and her team are interested in analyzing the Cyclistic historical bike trip data to identify trends.\n","\n","# **Ask**\n","\n","### **Questions to guide our analysis**\n","I have to answer the following questions to achieve the business task.\n","1. How do annual members and casual riders use Cyclistic bikes differently?\n","2. Why would casual riders buy Cyclistic annual memberships?\n","3. How can Cyclistic use digital media to influence casual riders to become members?\n","\n","### **Business Task** \n","The primary business task is to:\n","\n","1. Analyze Cyclistic's historical bike trip data to understand the differences in usage patterns between annual members and casual riders.\n","2. Identify the motivations and factors that lead casual riders to purchase Cyclistic annual memberships.\n","3. Develop effective digital media strategies that can influence casual riders to transition into becoming annual members.\n","\n","# **Prepare**\n","\n","### **Data Source** \n","I made use of Cyclistic's historical data from January 2022 to December 2022 for this project. The data was downloaded from divvy and the dataset can be accessed [here](https://divvy-tripdata.s3.amazonaws.com/index.html). It is an open data so it is accessible to the public.\n","\n","### **Data Organization**\n","The data is kept in csv files separated by month. All files contain usage of Cyclistic bikes including ride type, start and end stations (with station IDs and coordinates), as well as whether users are members or casual riders. Upon inspection of the 2022 files, however, it has been determined that some start and end points do not have names and IDs. All observations, nonetheless, have lat and long coordinates.\n","\n","### **Data Integrity and Credibility**\n","Going by the **ROCCC** standards:\n","1. It is **Reliable** as coordinates are present across all transactions eventhough the IDs and station names are missing for a lot of rows in the dataset. If there is a need to identify the station names and IDs of the missing values, we can simply match their coordinates to the coordinates of transactions with existing stations names/IDs.\n","2. It is **Original**; it belongs to Cyclistic so its a first party data.\n","3. It is **Comprehensive**. I am only working with 2022 data but record goes back to 2013.\n","4. It is **Current** because it was updated last month.\n","5. It is **Cited**. As I mentioned earlier, this is a first party data.\n","\n","# **Process**\n","\n","In order to process the 5,667,717 total records for 2022, spreadsheets wouldn’t be able to handle the sheer amount of data. I had to make use of Rstudio instead.\n","\n","The first step was to install & load the packages required for this process, which in this case were: **Tidyverse**, **Janitor** & **Lubridate**."]},{"cell_type":"code","execution_count":1,"id":"e9ce8b7b","metadata":{"execution":{"iopub.execute_input":"2024-08-20T23:19:13.100117Z","iopub.status.busy":"2024-08-20T23:19:13.097324Z","iopub.status.idle":"2024-08-20T23:20:01.787095Z","shell.execute_reply":"2024-08-20T23:20:01.784802Z"},"papermill":{"duration":48.707397,"end_time":"2024-08-20T23:20:01.790561","exception":false,"start_time":"2024-08-20T23:19:13.083164","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n","Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n","Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n"]}],"source":["#install the packages\n","install.packages(\"tidyverse\")\n","install.packages(\"janitor\")\n","install.packages(\"lubridate\")"]},{"cell_type":"code","execution_count":2,"id":"21dcae45","metadata":{"execution":{"iopub.execute_input":"2024-08-20T23:20:01.854412Z","iopub.status.busy":"2024-08-20T23:20:01.818291Z","iopub.status.idle":"2024-08-20T23:20:02.642768Z","shell.execute_reply":"2024-08-20T23:20:02.640739Z"},"papermill":{"duration":0.84093,"end_time":"2024-08-20T23:20:02.645746","exception":false,"start_time":"2024-08-20T23:20:01.804816","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["── \u001b[1mAttaching core tidyverse packages\u001b[22m ──────────────────────── tidyverse 2.0.0 ──\n","\u001b[32m✔\u001b[39m \u001b[