0.548545","exception":false,"start_time":"2024-08-20T23:25:50.518713","status":"completed"},"tags":[]},"source":["#### **Observation**\n","\n","• Kingsbury St & Kinzie St is the most used start and end station among annual members.\n","\n","• Streeter Dr & Grand Ave is the most used start and end station among casual riders.\n","\n","After careful observation of the plots above, I came up with the following hypotheses:\n","1. Most annual members are people that make use of our bikes as a means of transportation to and from their workplace.\n","2. Seeing as it is only casual members that rent the docked bycicles which is our least expensive bike type. I think a lot of our casual riders choose to not get the annual membership due to financial constraints.\n","3. Casual riders borrow longer because they want to have a more cost efficient means to go around.\n","4. Casual riders are service workers who go to the city to work only on weekends.\n","5. Casual riders are mostly tourists who come to spend their weekends in Chicago and decide to get a feel of the city."]},{"cell_type":"markdown","id":"acccbdb0","metadata":{"papermill":{"duration":0.030068,"end_time":"2024-08-20T23:25:50.610103","exception":false,"start_time":"2024-08-20T23:25:50.580035","status":"completed"},"tags":[]},"source":["# **Act**\n","\n","Based on my observations and insights gathered, I made the following recommendations to Moreno:\n","\n","1. We can make our email, SMS and app marketing more effective by targeting the casual riders during the weekends.\n","2. More promo offers and discounts on membership fees should also be directed to the casual riders during the mid months of June, July & August.\n","3. We should run surveys and get to hear from the casual riders directly at the stations they use the most. To better understand their hinderances from getting annual memberships.\n","4. Increase the pricing of single-day & full-day passes. By strategically pricing it higher, it would appeal to upgrade to an annual membership."]}],"metadata":{"kaggle":{"accelerator":"none","dataSources":[{"datasetId":2896511,"sourceId":4993619,"sourceType":"datasetVersion"}],"dockerImageVersionId":30530,"isGpuEnabled":false,"isInternetEnabled":true,"language":"r","sourceType":"notebook"},"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":401.947473,"end_time":"2024-08-20T23:25:51.267755","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2024-08-20T23:19:09.320282","version":"2.4.0"}},"nbformat":4,"nbformat_minor":5}